                var html = '<div class="block-file newEmailFile" data-id="' + countFilesEvent + '" style="display:none;"><div class="block-file-title"><span></span><a href="">X</a></div></div>';
                var fileInput = '<div class="block-file-input block-file-back" data-id="' + countFilesEvent + '">прикрепить файл<input type="file" id="attr-filename-' + countFilesEvent + '"  name="email-file[]" class="pozvonim-com-x-btn-file"></div>';
