    htmlUnescape = function (value) {
        var string = String(value)
            .replace(/&quot;/g, '"')
            .replace(/&lt;img/g, '<img')
            .replace(/&lt;div/g, '<div')
            .replace(/&lt;span/g, '<span')
            .replace(/&lt;a/g, '<a')
            .replace(/&lt;br/g, '<br')
            .replace(/&lt;\/a/g, '</a')
            .replace(/&lt;\/div/g, '</div')
            .replace(/&lt;\/span/g, '</span')
            .replace(/&gt;/g, '>')
            .replace(/&amp;/g, '&');

        return string;
    },
